import React from 'react';
import {
  ChakraProvider,
  Box,
  Container,
  Heading,
  Text,
} from '@chakra-ui/react';

function App() {
  return (
      <Container bg ="white" minH="100vh" minW="100vw">
        <Heading color="black" fontSize="5xl" textAlign="center" mt={10}>
          Image Compression
        </Heading>
        <Box>
        halo
        </Box>
      </Container>
  );
}

export default App;
